{
  "openapi": "3.0.0",
  "info": {
    "title": "Builder API",
    "version": "v1"
  },
  "servers": [
    {
      "url": "https://bldr.habitat.sh/v1",
      "variables": {
        "rootUri": {
          "description": "The root URI for the particular installation of Builder\n",
          "default": ""
        },
        "version": {
          "default": ""
        }
      },
      "x-amf-parameters": {
        "rootUri": {
          "description": "The root URI for the particular installation of Builder\n",
          "example": "bldr.habitat.sh, api.habitat.sh, localhost:9636"
        },
        "version": {}
      }
    }
  ],
  "consumes": [
    "application/json"
  ],
  "produces": [
    "application/json"
  ],
  "schemes": [
    "HTTPS"
  ],
  "paths": {
    "/authenticate/{code}": {
      "parameters": [
        {
          "name": "code",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        }
      ],
      "get": {
        "description": "Authenticates a user and creates a session",
        "responses": {
          "200": {
            "description": "Authorized",
            "content": {
              "application/json": {
                "schema": {
                  "example": {
                    "id": "73089155726360582",
                    "name": "reset",
                    "email": "reset@chef.io",
                    "token": "0b79bab50daca910b000d4f1a2b675d604257e42",
                    "flags": 0,
                    "oauth_token": "bb79bab50dbcab10b000d4f1a2bb75d604257e42"
                  },
                  "type": "object",
                  "x-amf-merge": [
                    {
                      "$ref": "#/components/schemas/session"
                    }
                  ]
                }
              }
            }
          },
          "401": {
            "description": "Unauthorized"
          }
        }
      }
    },
    "/depot/{origin}": {
      "parameters": [
        {
          "name": "origin",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        }
      ]
    },
    "/depot/{origin}/pkgs": {
      "parameters": [
        {
          "name": "origin",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        }
      ],
      "get": {
        "description": "Get list of unique packages for specified origin",
        "responses": {
          "200": {
            "description": "Successful",
            "content": {
              "application/json": {
                "schema": {
                  "example": {
                    "id": 1234567890,
                    "origin": "xyz",
                    "name": "abc",
                    "visibility": "private",
                    "owner_id": 77730215748435968
                  },
                  "type": "object",
                  "x-amf-merge": [
                    {
                      "$ref": "#/components/schemas/packageSettings"
                    }
                  ]
                }
              }
            }
          },
          "206": {
            "description": "Partial list of packages",
            "content": {
              "application/json": {
                "schema": {
                  "example": {
                    "id": 1234567890,
                    "origin": "xyz",
                    "name": "abc",
                    "visibility": "private",
                    "owner_id": 77730215748435968
                  },
                  "type": "object",
                  "x-amf-merge": [
                    {
                      "$ref": "#/components/schemas/packageSettings"
                    }
                  ]
                }
              }
            }
          },
          "401": {
            "description": "Unauthorized"
          },
          "500": {
            "description": "Internal server error"
          }
        }
      }
    },
    "/rdeps/{origin}": {
      "parameters": [
        {
          "name": "origin",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        }
      ]
    },
    "/rdeps/{origin}/{name}": {
      "parameters": [
        {
          "name": "origin",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        },
        {
          "name": "name",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        }
      ],
      "get": {
        "description": "Retrieves the list of reverse dependencies for this package.\n",
        "responses": {
          "200": {
            "description": "Retrieve reverse dependencies for package",
            "content": {
              "application/json": {
                "schema": {
                  "example": {
                    "origin": "core",
                    "name": "linux-headers",
                    "rdeps": [
                      "core/redis"
                    ]
                  }
                }
              }
            }
          },
          "404": {
            "description": "Package not found"
          },
          "500": {
            "description": "Internal server error"
          }
        }
      }
    },
    "/rdeps/{origin}/{name}/group": {
      "parameters": [
        {
          "name": "origin",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        },
        {
          "name": "name",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        }
      ],
      "get": {
        "description": "Retrieves the list of reverse dependencies for this package,\ncollated into build groups that can be build in parallel\n",
        "responses": {
          "200": {
            "description": "Retrieved dependencies organized into build groups",
            "content": {
              "application/json": {
                "schema": {
                  "example": {
                    "origin": "core",
                    "name": "linux-headers",
                    "rdeps": [
                      {
                        "group": 0,
                        "idents": [
                          "core/redis",
                          "core/protobuf"
                        ]
                      },
                      {
                        "group": 1,
                        "idents": [
                          "core/node"
                        ]
                      }
                    ]
                  }
                }
              }
            }
          },
          "404": {
            "description": "Package not found"
          },
          "500": {
            "description": "Internal server error"
          }
        }
      }
    },
    "/status": {
      "get": {
        "description": "Returns the health of the service",
        "responses": {
          "200": {
            "description": "Service is healthy"
          },
          "500": {
            "description": "Server fault"
          },
          "503": {
            "description": "Service temporarily unavailable"
          }
        }
      },
      "head": {
        "description": "Returns the health of the service",
        "responses": {
          "200": {
            "description": "Service is healthy"
          },
          "500": {
            "description": "Server fault"
          },
          "503": {
            "description": "Service temporarily unavailable"
          }
        }
      }
    },
    "/ext": {},
    "/ext/installations/{install_id}": {
      "parameters": [
        {
          "name": "install_id",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        }
      ]
    },
    "/ext/installations/{install_id}/repos/{repo_id}": {
      "parameters": [
        {
          "name": "install_id",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        },
        {
          "name": "repo_id",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        }
      ]
    },
    "/ext/installations/{install_id}/repos/{repo_id}/contents/{path}": {
      "parameters": [
        {
          "name": "install_id",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        },
        {
          "name": "repo_id",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        },
        {
          "name": "path",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        }
      ],
      "get": {
        "description": "Get content from github",
        "responses": {
          "200": {
            "description": "Got content from github",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "x-amf-merge": [
                    {
                      "$ref": "#/components/schemas/content"
                    }
                  ]
                }
              }
            }
          },
          "400": {
            "description": "Bad search query parameter provided"
          },
          "401": {
            "description": "Unauthorized"
          }
        }
      }
    },
    "/ext/integrations/{registry_type}": {
      "parameters": [
        {
          "name": "registry_type",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        }
      ]
    },
    "/ext/integrations/{registry_type}/credentials/validate": {
      "parameters": [
        {
          "name": "registry_type",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        }
      ],
      "post": {
        "description": "Validates registry credentials",
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "example": {
                  "user": "user",
                  "password": "password",
                  "url": "url"
                }
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "Registry credentials validated"
          },
          "400": {
            "description": "Bad Request"
          },
          "401": {
            "description": "Authentication failed"
          }
        }
      }
    },
    "/profile": {
      "get": {
        "description": "Retrieve your profile",
        "responses": {
          "200": {
            "description": "Retrieved profile",
            "content": {
              "application/json": {
                "schema": {
                  "example": {
                    "id": "1234567890",
                    "name": "jimmy",
                    "email": "jimmy@example.com"
                  },
                  "type": "object",
                  "x-amf-merge": [
                    {
                      "$ref": "#/components/schemas/userProfile"
                    }
                  ]
                }
              }
            }
          },
          "401": {
            "description": "Authentication failed"
          }
        },
        "security": [
          {
            "oauth_2_0": []
          }
        ]
      },
      "patch": {
        "description": "Update your profile",
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "example": {
                  "email": "jimmy@example.com"
                },
                "type": "object",
                "x-amf-merge": [
                  {
                    "$ref": "#/components/schemas/userProfileUpdate"
                  }
                ]
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "Update successful"
          },
          "401": {
            "description": "Authentication failed"
          },
          "422": {
            "description": "Bad JSON submitted"
          }
        },
        "security": [
          {
            "oauth_2_0": []
          }
        ]
      }
    },
    "/profile/access-tokens": {
      "get": {
        "description": "Retrieve your personal access tokens",
        "responses": {
          "200": {
            "description": "Retrieved tokens",
            "content": {
              "application/json": {
                "schema": {
                  "example": [
                    {
                      "id": 1,
                      "account_id": 2,
                      "token": "abcdefg",
                      "created_at": "2022-01-29 09:42:15.273364+00"
                    },
                    {
                      "id": 3,
                      "account_id": 21,
                      "token": "abcdefgihijk",
                      "created_at": "2022-01-31 09:42:15.273364+00"
                    }
                  ],
                  "type": "object",
                  "x-amf-merge": [
                    {
                      "$ref": "#/components/schemas/accountTokens"
                    }
                  ]
                }
              }
            }
          },
          "401": {
            "description": "Authentication failed"
          }
        },
        "security": [
          {
            "oauth_2_0": []
          }
        ]
      },
      "post": {
        "description": "Generate a new personal access token",
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {}
            }
          }
        },
        "responses": {
          "200": {
            "description": "Generated personal access token",
            "content": {
              "application/json": {
                "schema": {}
              }
            }
          },
          "400": {
            "description": "Received a malformed JSON body"
          },
          "401": {
            "description": "Authentication failed"
          }
        },
        "security": [
          {
            "oauth_2_0": []
          }
        ]
      }
    },
    "/profile/access-tokens/{id}": {
      "parameters": [
        {
          "name": "id",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        }
      ],
      "delete": {
        "description": "Delete (revoke) a personal access token",
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {}
            }
          }
        },
        "responses": {
          "200": {
            "description": "Delete successful"
          },
          "401": {
            "description": "Authentication failed"
          }
        },
        "security": [
          {
            "oauth_2_0": []
          }
        ]
      }
    },
    "/jobs": {},
    "/jobs/{jobId}": {
      "parameters": [
        {
          "name": "jobId",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        }
      ],
      "get": {
        "description": "Get the status of the given job",
        "responses": {
          "200": {
            "description": "Retrieved job status",
            "content": {
              "application/json": {
                "schema": {
                  "example": {
                    "id": "73089155726360582",
                    "origin": "core",
                    "project": "nginx",
                    "version": "1.0.0",
                    "release": "20170505001756",
                    "state": "Complete",
                    "created_at": "2017-05-05 00:42:35.213765+00",
                    "build_started_at": "2017-05-05 00:43:11.729835+00",
                    "build_finished_at": "2017-05-05 00:44:00.896919+00"
                  },
                  "type": "object",
                  "x-amf-merge": [
                    {
                      "$ref": "#/components/schemas/job"
                    }
                  ]
                }
              }
            }
          },
          "400": {
            "description": "Received a jobId that was not a number"
          }
        }
      }
    },
    "/jobs/{jobId}/log": {
      "parameters": [
        {
          "name": "jobId",
          "required": true,
          "in": "path",
          "schema": {
            "type": "string"
          }
        }
      ],
      "get": {
        "description": "Get the build log (or a portion thereof) for the\ngiven job. Until an SSE endpoint can be implemented,\nthis endpoint can be used to poll for the logs of a\ncurrently-running job; use of the `start` query\nparameter ensures that only the portion of the log\nthat is \"new\", relative to a prior request, will be\nretrieved.\n",
        "parameters": [
          {
            "name": "start",
            "description": "Return the portion of the log output that\nstarts at the zero-indexed line\nspecified. A request with no given value\ndefaults to `0`; in other words, the\nentire log will be sent back.\n",
            "required": false,
            "in": "query",
            "schema": {
              "description": "Return the portion of the log output that\nstarts at the zero-indexed line\nspecified. A request with no given value\ndefaults to `0`; in other words, the\nentire log will be sent back.\n",
              "default": 0,
              "example": 100,
              "type": "integer",
              "minimum": 0
            }
          },
          {
            "name": "color",
            "description": "Whether or not to include embedded ANSI color\ncodes in the log output. By default, all ANSI\nsequences are removed, yielding plain output.\n\nThe following values are interpreted as `true`:\n  * `true`\n  * `TRUE`\n  * `t`\n  * `T`\n  * `1`\n  * `on`\n  * `ON`\n\nThe following values are interpreted as `false`:\n  * `false`\n  * `FALSE`\n  * `f`\n  * `F`\n  * `0`\n  * `off`\n  * `OFF`\n\nAll other values are considered `false`.\n",
            "required": false,
            "in": "query",
            "schema": {
              "description": "Whether or not to include embedded ANSI color\ncodes in the log output. By default, all ANSI\nsequences are removed, yielding plain output.\n\nThe following values are interpreted as `true`:\n  * `true`\n  * `TRUE`\n  * `t`\n  * `T`\n  * `1`\n  * `on`\n  * `ON`\n\nThe following values are interpreted as `false`:\n  * `false`\n  * `FALSE`\n  * `f`\n  * `F`\n  * `0`\n  * `off`\n  * `OFF`\n\nAll other values are considered `false`.\n",
              "default": false,
              "type": "boolean"
            }
          }
        ],
        "responses": {
          "200": {
            "description": "Retrieved build log",
            "content": {
              "application/json": {
                "schema": {
                  "example": {
                    "start": 0,
                    "stop": 2,
                    "content": [
                      "this is the first line",
                      "this is the second line"
                    ],
                    "is_complete": false
                  },
                  "type": "object",
                  "x-amf-merge": [
                    {
                      "$ref": "#/components/schemas/jobLog"
                    }
                  ]
                }
              }
            }
          },
          "400": {
            "description": "Received a jobId that was not a number, or\nan invalid value for the `start` query\nparameter (e.g., negative, or larger than\nthe actual size of the log file.\n"
          },
          "404": {
            "description": "Job does not exist with corresponding jobId,\nor no log was found for the given job.\n"
          }
        }
      }
    },
    "/jobs/group/{id}": {
      "parameters": [
        {
          "name": "id",
